            jobState = "review";
        } else if (keccak256(bytes(_state)) == keccak256(bytes("completed"))) {
            jobState = "completed";
        } else if (keccak256(bytes(_state)) == keccak256(bytes("canceled"))) {
            jobState = "canceled";
        }

        // emit OneEventForAll2(contractAddress);
